import {Box, Button} from '@mui/material'


function App() {
  return (
    <div className="App">
      <Box display="flex" justifyContent="space-between" mt={10}><Button variant="contained" css={buttonCss}>
        use SHA256
        </Button>
        <Button variant="contained">
        use STREEBOG
        </Button></Box>
    </div>
  );
}

export default App;
